import React from 'react';
import ReactDOM from 'react-dom';
import Skills from './Skills'

class Nav2 extends React.Component {
    links = [
        {
            text: "<Home />",
            url: "http://localhost:3000/",
            color: "green"
        },
        {
            text: "About",
            url: "http://localhost:3000/",
            color: "white"
        },
        {
            text: "Contact",
            url: "http://localhost:3000/",
            color: "white"
        }
    ]

    listLinks = this.links.map((link) =>
            <li><a href={link.url} className={link.color}>{link.text}</a></li>
    );

    render() {
        return (
            <nav className="portfolio-nav">
                <div className="container">
                    <div className="portfolio-nav-row row">
                        <div className="nav-logo col-md">
                            <div>George Kilburg</div>
                        </div>
                        <div className="nav-skills col-md">
                            {<Skills />}
                        </div>
                    </div>
                </div>
            </nav>
        );
    }
}

ReactDOM.render(<Nav2 />, document.getElementById('root'))
export default Nav2;
